import React from 'react';
import {Router, Switch} from 'react-router-dom'

import Navbar from './Navbar'
import PokeDex from './PokeDex';
import Pokemon from './Pokemon';

function App() {
  return (
    <Switch>
     <Route path="/" render={(props) => <PokeDex {...props} />} />
    </Switch>
  )
}

export default App;
